import React, { useState, useEffect } from 'react';
import { Button, Table, Form, Modal } from 'react-bootstrap';
import axios from 'axios';

const Owner = () => {
  const [owners, setOwners] = useState([]);
  const [showAddModal, setShowAddModal] = useState(false);
  const [showEditModal, setShowEditModal] = useState(false);
  const [showDeleteModal, setShowDeleteModal] = useState(false);
  const [selectedOwner, setSelectedOwner] = useState({});
  const [newOwner, setNewOwner] = useState({
    name: '',
    age: '',
    address: '',
  });

  const getOwners = async () => {
    const response = await axios.get('http://localhost:3000/Owner');
    setOwners(response.data);
  };

  const addOwner = async () => {
    await axios.post('http://localhost:3000/Owner', newOwner);
    setShowAddModal(false);
    setNewOwner({ name: '', age: '', address: '' });
    getOwners();
  };

  const editOwner = async () => {
    await axios.put(`http://localhost:3000/Owner/${selectedOwner.id}`, selectedOwner);
    setShowEditModal(false);
    setSelectedOwner({});
    getOwners();
  };

  const deleteOwner = async () => {
    await axios.delete(`http://localhost:3000/Owner/${selectedOwner.id}`);
    setShowDeleteModal(false);
    setSelectedOwner({});
    getOwners();
  };

  useEffect(() => {
    getOwners();
  }, []);

  return (
    <div>
      <h1>Owners</h1>
      <Button variant="primary" onClick={() => setShowAddModal(true)}>Add Owner</Button>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Name</th>
            <th>Age</th>
            <th>Address</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {owners.map(owner => (
            <tr key={owner.id}>
              <td>{owner.name}</td>
              <td>{owner.age}</td>
              <td>{owner.address}</td>
              <td>
                <Button variant="warning" onClick={() => {
                  setSelectedOwner(owner);
                  setShowEditModal(true);
                }}>Edit</Button>
                <Button variant="danger" onClick={() => {
                  setSelectedOwner(owner);
                  setShowDeleteModal(true);
                }}>Delete</Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>
      <Modal show={showAddModal} onHide={() => setShowAddModal(false)}>
        <Modal.Header closeButton>
          <Modal.Title>Add Owner</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            <Form.Group controlId="formName">
              <Form.Label>Name</Form.Label>
              <Form.Control type="text" placeholder="Enter name" value={newOwner.name} onChange={(e) => {
                setNewOwner({ ...newOwner, name: e.target.value });
              }} />
            </Form.Group>
            <Form.Group controlId="formAge">
              <Form.Label>Age</Form.Label>
              <Form.Control type="number" placeholder="Enter age" value={newOwner.age} onChange={(e) => {
                setNewOwner({ ...newOwner, age: e.target.value });
              }} />
            </Form.Group>
            <Form.Group controlId="formAddress">
              <Form.Label>Address</Form.Label>
              <Form.Control type="text" placeholder="Enter address" value={newOwner.address} onChange={(e) => {
                setNewOwner({ ...newOwner, address: e.target.value });
              }} />
            </Form.Group>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={() => setShowAddModal(false)}>Close</Button>
          <Button variant="primary" onClick={() => addOwner()}>Save</Button>
        </Modal.Footer>
      </Modal>
      <Modal show={showEditModal} onHide={() => setShowEditModal(false)}>
        <Modal.Header closeButton>
          <Modal.Title>Edit Owner</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            <Form.Group controlId="formName">
              <Form.Label>Name</Form.Label>
              <Form.Control type="text" placeholder="Enter name" value={selectedOwner.name} onChange={(e) => {
                setSelectedOwner({ ...selectedOwner, name: e.target.value });
              }} />
            </Form.Group>
            <Form.Group controlId="formAge">
              <Form.Label>Age</Form.Label>
              <Form.Control type="number" placeholder="Enter age" value={selectedOwner.age} onChange={(e) => {
                setSelectedOwner({ ...selectedOwner, age: e.target.value });
              }} />
            </Form.Group>
            <Form.Group controlId="formAddress">
              <Form.Label>Address</Form.Label>
              <Form.Control type="text" placeholder="Enter address" value={selectedOwner.address} onChange={(e) => {
                setSelectedOwner({ ...selectedOwner, address: e.target.value });
              }} />
            </Form.Group>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={() => setShowEditModal(false)}>Close</Button>
          <Button variant="primary" onClick={() => editOwner()}>Save</Button>
        </Modal.Footer>
      </Modal>
      <Modal show={showDeleteModal} onHide={() => setShowDeleteModal(false)}>
        <Modal.Header closeButton>
          <Modal.Title>Delete Owner</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          Are you sure you want to delete {selectedOwner.name}?
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={() => setShowDeleteModal(false)}>Cancel</Button>
          <Button variant="danger" onClick={() => deleteOwner()}>Delete</Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
};

export default Owner;
